import React from 'react';
import './App.css';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableHead';
import IconButton from '@material-ui/core/IconButton';
import HighlightOffIcon from '@material-ui/icons/HighlightOff';


class Cart extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }  

  render() {
    return (
      <TableRow>
          <TableCell><img src={this.props.image} alt="item"/> </TableCell>
          <TableCell>{this.props.name}</TableCell>
          <TableCell>{this.props.price}</TableCell>
          <TableCell>{this.props.count}</TableCell>
          <TableCell><IconButton onClick={this.props.handleRemove(this.props.name)}><HighlightOffIcon/></IconButton></TableCell>
      </TableRow>

    )
  }
}

export default Cart;
